import React from "react";
import { Map, Marker } from "pigeon-maps";

const Maps = (props) => {
  return (
    <div>
      <Map
        height={300}
        defaultCenter={[50.879, 4.6997]}
        defaultZoom={11}
        provider={() => {
          return `https://api.maptiler.com/maps/streets-v2/?key=pBn7AlJ7MBLLXtHdXem4#0.8/8.64231/10.50369`;
        }}
      >
        <Marker width={50} anchor={[50.879, 4.6997]} />
      </Map>
    </div>
  );
};
export default Maps;
